import React from 'react';
import { NativeBaseProvider, Center, Container } from 'native-base';
import AppNavigator from './AppNavigator';

export default function App() {
  return (
    <NativeBaseProvider>
      <Center flex={1} bg="#fff">
        <Container>
          <AppNavigator />
        </Container>
      </Center>
    </NativeBaseProvider>
  );
}
